import React, {useState, useEffect} from 'react';
import { View, Dimensions, Text, Image } from 'react-native';
import { Snackbar } from 'react-native-paper';
import AsyncStorage from '@react-native-community/async-storage';
import AppConstants from '../constants.json'
import { Icon } from 'react-native-elements'
import { LoginButton, AccessToken, GraphRequest, GraphRequestManager, LoginManager } from 'react-native-fbsdk';
import { useIsFocused } from "@react-navigation/native";
 
const Login = ({route, navigation}) => {

    const { width, height } = Dimensions.get('window');
    const [isLoginClicked, setLoginClicked] = useState(false);
    const [showLogin, setShowLogin] = useState(false);
    const [snackBarText, setSnackBarText] = useState('');
    const onDismissSnackBar = () => setSnackBarText('');
    const SUCCESS_CODE_UPDATE = 3001;
    const SUCCESS_CODE_INSERT = 3002;
    const isFocused = useIsFocused();

    const isLoggedIn = async () => {
        let fbAccessTokenItem = await AsyncStorage.getItem('FB_ACCESS_TOKEN');
        let token = await AccessToken.getCurrentAccessToken();
        return null !== fbAccessTokenItem && null !== token && null != token["accessToken"] && fbAccessTokenItem === token["accessToken"];
    }

    const fbResponseCallback = (error, result) => {
        if (error) 
        {
            LoginManager.logOut();
            setLoginClicked(false);
            setSnackBarText('Error during login, try again.');
        } 
        else 
        {
            const xhr = new XMLHttpRequest();
            const formData = new FormData();
            formData.append('task', 'login');
            formData.append('socialMedia', 'Facebook');
            if(null !== result)
            {
                if(null !== result['id'])
                    formData.append('socialMediaID', result['id']);
                if(null !== result['name'])
                    formData.append('name', result['name']);
                if(null !== result['email'])
                    formData.append('email', result['email']);
                if(null !== result['picture'] && null !== result['picture']['data'] && null !== result['picture']['data']['url'])
                    formData.append('pictureURL', result['picture']['data']['url']);
            }
            xhr.onerror = () => {
                LoginManager.logOut();
                setLoginClicked(false);
                setSnackBarText('Error during login, try again.');
            };
            xhr.ontimeout = () => {
                LoginManager.logOut();
                setLoginClicked(false);
                setSnackBarText('Connection to server timed out.');
            };
            xhr.onload = () => {
                const jsonResponse = JSON.parse(xhr.response);
                if(null !== jsonResponse && null !== jsonResponse['code'] && (SUCCESS_CODE_INSERT == jsonResponse['code'] || SUCCESS_CODE_UPDATE == jsonResponse['code']))
                {
                    AsyncStorage.setItem('FROM_ID', jsonResponse["data"]);
                    navigation.navigate('Home');
                }
                else
                {
                    setLoginClicked(false);
                    LoginManager.logOut();
                    setSnackBarText('Error during login, try again.');
                }
            };
            xhr.open('POST', AppConstants.BACKEND_INDEX_URL + '?' + Math.random().toString(36).slice(2) /*to avoid cache*/);
            xhr.setRequestHeader('Content-Type', 'multipart/form-data');
            xhr.timeout = 5000;
            xhr.send(formData);
        }
    }

    useEffect(async () => {
        if(!isFocused) return;
        if(!showLogin && await isLoggedIn())
        {
            navigation.navigate('Home');
        }
        else
        {
            setLoginClicked(false);
            setShowLogin(true);
        }
    }, [isFocused]);

    return showLogin ? (
        <View style={{backgroundColor:'#fff', height: height, flexDirection: 'column'}}>
            <View style={{flex: height*0.7, backgroundColor:'#fff', justifyContent:'center', alignItems:'center'}}>
                <View style={{flexDirection:'row'}}>
                    <View style={{alignSelf:'center'}}>
                        <Image style={{ width: 64, height: 64 }} source={{uri: 'data:image/png;base64,'}} />
                    </View>
                    <View style={{alignSelf:'center'}}>
                        <Text style={{fontSize:42}}>onnections</Text>
                    </View>
                </View>
                <Text />
                <Text style={{fontSize:14}}>Stop Looking. Start Searching!</Text>
            </View>
            <View style={{flex: height*0.3, justifyContent:'center', alignItems:'center'}}>
                <Text style={{fontSize:14}}>Get Started!</Text>
                <Text />
                {isLoginClicked ? 
                <Text style={{fontSize:22, fontWeight:'bold', color:AppConstants.THEME_COLOR}}>Initiating. Please wait ...</Text> :
                <LoginButton
                    readPermissions={['public_profile', 'email']}
                    onLoginFinished={(error, result) => {
                        if(error || result.isCancelled)
                        {
                            LoginManager.logOut();
                            setLoginClicked(false);
                            setSnackBarText(result.isCancelled ? 'Login was cancelled.' : 'Error during login, try again.');
                        }
                        else 
                        {
                            setLoginClicked(true);
                            AccessToken.getCurrentAccessToken().then((data) => {
                                AsyncStorage.setItem('FB_ACCESS_TOKEN', data["accessToken"]);
                                const processRequest = new GraphRequest(
                                    '/me?fields=id,name,picture.type(large),email',
                                    null,
                                    fbResponseCallback
                                );
                                new GraphRequestManager().addRequest(processRequest).start();
                            });
                        }
                    }}
                    onLogoutFinished={() => console.log("logout.")}
                />}
            </View>
            <Snackbar
                visible={snackBarText.length != 0}
                onDismiss={onDismissSnackBar}
                action={{
                    label: 'Ok'
                }}>
                {snackBarText}
            </Snackbar>
        </View>
    ) : null;
}

export default Login;